//初始狀態;條件;更新內容
for(var i=0;i<3;i++){
    console.log(i)
}

for(var i=0;i<10;i++){
    console.log(i*i)
}

for(var i=1;i<10;i++){
    console.log(i+'*'+i+'='+i*i)
}
// "0*0=0"
// "1*1=1"
// "2*2=4"

var farms = [
    {
        farmer:'卡斯伯',
        field: 6,
        chick: 200,
        banana: 5000,
    },
    {
        farmer:'查理',
        field: 10,
        chick: 50,
        banana: 1000,
    },
    {
        farmer:'約翰',
        field: 8,
        chick: 120,
        banana: 3215,
    }
]

var farmsTotal = farms.length;

var bananaTotal = 0;

for(var i=0;i<farmsTotal;i++){
    console.log('第'+(i+1)+'個農場主人是'+ farms[i].farmer); // 第一個農場主人是卡斯伯
    bananaTotal+= farms[i].banana;
    if(farms[i].chick>50){
        console.log(farms[i].farmer+'的小雞剛好夠');
        farms[i].chick-= 50;
        console.log(farms[i].farmer+'的小雞剩下'+farms[i].chick);
        break;
    }
}

console.log('今年村子的香蕉採收量'+bananaTotal); // 今年的香蕉採收總數


// 撈出哪些的農場的小雞數量超過100隻以上
for(var i=0;i<farmsTotal;i++){
    if(farms[i].chick>100){
        console.log(farms[i].farmer+'的小雞超過100隻以上');
    }
}


